define("",["lib_cmd/vue-cmd"],function(require,exports,module){var t=require("lib_cmd/vue-cmd");t.component("v-msg-content",{props:["datanow"],data:function(){return{}},template:' <div v-if="datanow.show" class="row v-table-msg-c">                      <div class="col-md-12 col-lg-12 clearfix">                           <h5 class="text-left">{{datanow.title}}</h5>                          <div class="col-md-8 col-md-offset-1 v-msg-box">                               <p class="v-msg-content">                                  {{datanow.content}}                               </p>                          </div>                          <div class="col-md-12  ">                               <p class="v-msg-f pull-right col-md-2">                                   {{datanow.company}}<br>                                   {{datanow.date}}                               </p>                          </div>                      </div>                      <div class="col-lg-12  col-md-12 v-msg-f-btn">                        <template v-if="datanow.type==\'INTERVIEW\'||datanow.type==\'SUGGESTION\'">                          <div class="col-md-2"  >                            <button type="button"  @click="Confirm($event)" :data-id="datanow.id" :data-msg-id="datanow.msg_id" :data-type="datanow.type" status="CONFIRMED"  class="btn btn-primary btn-block">同意</button>                          </div>                          <div class="col-md-2">                            <button type="button"  @click="Confirm($event)" :data-id="datanow.id"  :data-msg-id="datanow.msg_id"  :data-type="datanow.type" status="NEGOTIATION"  class="btn btn-primary  btn-block">协商</button>                          </div>                        </template>                      </div>                       <div class="col-lg-12  col-md-12 v-msg-f-btn text-center">                        <p class="confirm-msg" style="padding-top:50px;font-size:16px;"> </p>                       </div>                </div>        ',methods:{readyMsg:function(t){var a=$(t.target).attr("data-id"),d=this;console.log(d.datanow.isRead),"false"==d.datanow.isRead?$.get("/api/read/message?id="+a).then(function(t){t.success?($(".confirm-msg").html("提交成功"),d.datanow.isRead="true"):$(".confirm-msg").html("提交失败")}):alert("已阅读")},Confirm:function(t){var a=$(t.target).attr("data-type"),d={status:$(t.target).attr("status"),id:$(t.target).attr("data-msg-id")};if("INTERVIEW"==a)var s="/api/interview/confirm";else if("SUGGESTION"==a)var s="/api/interview/confirm";a&&$.post(s,d).then(function(t){t.success?$(".confirm-msg").html("提交成功"):$(".confirm-msg").html("提交失败")})}}})});